def splitext(p):
    return os.path.splitext(p)[1].lower()


def is_number(num):
    try:
        if num == 'NaN':
            return False
        float(num)
        return True
    except ValueError:
        return False


def icon_from_base64(base64):
    pixmap = QPixmap()
    pixmap.loadFromData(QByteArray.fromBase64(base64))
    icon = QIcon(pixmap)
    return icon


class UI(QMainWindow):
    def __init__(self, parent=None):
        super().__init__(parent)
        # This is `student.ico`'s base64 encode string.
        img_b64 = b''
        icon = icon_from_base64(img_b64)
        self.setWindowIcon(icon)
        self.setWindowTitle(u"")
        self.resize(1332, 700)
        # creating EmailBlast widget and setting it as central
        self.uiwidget = UIQWidget(parent=self)
        self.setCentralWidget(self.uiwidget)
        # self.path holds the path of the currently open file.
        # If none, we haven't got a file open yet (or creating new).
        self.path = None
        # filling up a menu bar
        bar = self.menuBar()
        # File menu
        file_menu = bar.addMenu(u"&(File)")
        # adding actions to file menu
        open_file_action = QAction(icon_from_base64(images.BLUE_FOLDER_OPEN_DOCUMENT), u"...", self)
        open_file_action.setStatusTip(u"")
        open_file_action.setShortcut("Ctrl+O")
        open_file_action.triggered.connect(self.file_open)
        file_menu.addAction(open_file_action)

        save_file_action = QAction(icon_from_base64(images.DISK), u"", self)
        save_file_action.setStatusTip(u"")
        save_file_action.setShortcut("Ctrl+S")
        save_file_action.triggered.connect(self.file_save)
        file_menu.addAction(save_file_action)

        saveas_file_action = QAction(icon_from_base64(images.DISK__PENCIL), u"...", self)
        saveas_file_action.setStatusTip(u"")
        saveas_file_action.setShortcut(Qt.Key_F12)
        saveas_file_action.triggered.connect(self.file_saveas)
        file_menu.addAction(saveas_file_action)

        print_action = QAction(icon_from_base64(images.PRINTER), u"...", self)
        print_action.setStatusTip(u"")
        print_action.setShortcut("Ctrl+P")
        print_action.triggered.connect(self.file_print)
        file_menu.addAction(print_action)

        # Used to display Chinese characters and minus sign normally
        plt.rcParams['font.sans-serif'] = ['SimHei']
        plt.rcParams['axes.unicode_minus'] = False

        self.statusBar()
        self.show()

    def dialog_critical(self, s):
        """
        Show the critical-level message box.
        :param s: String type. The information to show.
        """
        dlg = QMessageBox(self)
        dlg.setText(s)
        dlg.setIcon(QMessageBox.Critical)
        dlg.show()

    def file_open(self):
        """
        Open the data file.
        """
        path, _ = QFileDialog.getOpenFileName(self, u"", "", u"(*.xlsx;*.xls;*.xlsm;*.csv;*.ods)")
        if not path:
            # If dialog is cancelled, will return ""
            return
        try:
            records = pyexcel.get_records(file_name=path)
        except Exception as e:
            self.dialog_critical(str(e))
        else:
            self.path = path
            for record in records:
                self.uiwidget.add_line(record)
            self.update_title()

    def file_save(self):
        """
        Save file.
        """
        if self.path is None:
            # If we do not have a path, we need to use Save As.
            return self.file_saveas()
        try:
            content = self.uiwidget.get_book()
            book = pyexcel.get_book(bookdict=content)
            if os.path.splitext(os.path.basename(self.path))[1] == '.csv':
                book.save_as(self.path, encoding='utf-8-sig')
            else:
                book.save_as(self.path)
            self.update_title()

        except Exception as e:
            self.dialog_critical(str(e))

    def file_saveas(self):
        """
        Save file as...
        """
        path, _ = QFileDialog.getSaveFileName(
            self, u"", "", u"xlsx(*.xlsx);;xls(*.xls);;xlsm(*.xlsm);;csv(*.csv);;ods(*.ods)")
        if not path:
            # If dialog is cancelled, will return ""
            return
        try:
            content = self.uiwidget.get_book()
            book = pyexcel.get_book(bookdict=content)
            if os.path.splitext(os.path.basename(path))[1] == '.csv':
                book.save_as(path, encoding='utf-8-sig')
            else:
                book.save_as(path)
        except Exception as e:
            self.dialog_critical(str(e))
        else:
            self.path = path
            self.update_title()

    def file_print(self):
        """
        Print this file.
        """
        dlg = QPrintDialog()
        if dlg.exec_():
            self.handle_print_request(dlg.printer())

    def update_title(self):
        """
        Update the window's title.
        """
        self.setWindowTitle(u"%s - " % (os.path.basename(self.path) if self.path else "Untitled"))

    def handle_print_request(self, printer):
        """
        What we need to print is a table. This method converts the table and some special items into printable mode.
        :param printer: A printer to use.
        """
        document = QTextDocument()
        cursor = QTextCursor(document)
        table = cursor.insertTable(self.uiwidget.table.rowCount() + 1, self.uiwidget.table.columnCount())

        for h in self.uiwidget.headers:
            cursor.insertText(h)
            cursor.movePosition(QTextCursor.NextCell)

        for row in range(table.rows()):
            for col in range(table.columns()):
                w = self.uiwidget.table.cellWidget(row, col)
                it = self.uiwidget.table.item(row, col)
                if w is not None:
                    cursor.insertText(u'' if self.uiwidget.table.item(row, col + 1).text() in self.uiwidget.selected
                                      else u'')
                elif it is not None:
                    cursor.insertText(it.text())
                cursor.movePosition(QTextCursor.NextCell)
        document.print_(printer)


