    def add_line(self, data=None):
        """
        Add a new line to the table area. If `data` is provided, it will load data from the `data`.
        :param data: The data to load. Default is none. In this case, it will use random data to fill the table.
        """
        row = self.table.rowCount()
        self.table.setRowCount(row + 1)
        stu_id = 'B17' + '%06d' % self.stu_id if not data else str(data[self.headers[1]])
        ck = QCheckBox()
        ck.stateChanged.connect(lambda: (lambda s, status: self.selected.add(s) if status else self.selected.discard(s))
                                        (stu_id, ck.isChecked()))
        h = QHBoxLayout()
        h.setAlignment(Qt.AlignCenter)
        h.addWidget(ck)
        w = QWidget()
        w.setLayout(h)
        if data:
            name = data[self.headers[2]] if self.headers[2] in data else ''
            description = data[self.headers[7]] if self.headers[7] in data else ''
        else:
            name = self.faker.name()
            description = self.faker.address()
            self.stu_id += 1
        self.table.setCellWidget(row, 0, w)
        self.table.setItem(row, 1, QTableWidgetItem(stu_id))
        self.table.setItem(row, 2, QTableWidgetItem(name))
        # it will set integer instead of string
        item = QTableWidgetItem()
        item.setData(Qt.EditRole, float(data[self.headers[3]]) if (data and self.headers[3] in data) else round(
            random.uniform(50, 100), 1))
        self.table.setItem(row, 3, item)

        item = QTableWidgetItem()
        item.setData(Qt.EditRole, float(data[self.headers[4]]) if (data and self.headers[4] in data) else round(
            random.uniform(50, 100), 1))
        self.table.setItem(row, 4, item)

        item = QTableWidgetItem()
        item.setData(Qt.EditRole, float(data[self.headers[5]]) if (data and self.headers[5] in data) else round(
            random.uniform(50, 100), 1))
        self.table.setItem(row, 5, item)

        if data and self.headers[6] in data:
            item = QTableWidgetItem()
            item.setData(Qt.EditRole, float(data[self.headers[6]]))
            self.table.setItem(row, 6, item)
        else:
            self.table.setItem(row, 6, QTableWidgetItem(''))

        self.table.setItem(row, 7,
                           QTableWidgetItem(str(data[self.headers[7]]) if (data and self.headers[7] in data) else ''))

        self.table.setItem(row, 8, QTableWidgetItem(description))
        for y in range(1, 9):
            item = self.table.item(row, y)
            item.setTextAlignment(Qt.AlignCenter)

    def del_line(self):
        """
        Delete a line.
        """
        row = self.table.rowCount()
        for x in range(row, 0, -1):
            # keyword: stu_id
            if self.table.item(x - 1, 1).text() in self.selected:
                self.table.removeRow(x - 1)
        self.selected.clear()

    def modify_line(self):
        """
        Decide whether the line can be edited or not.
        """
        if self.editable:
            self.table.setEditTriggers(QAbstractItemView.NoEditTriggers)
            self.btn_modify.setText(u"")
            self.editable = False
        else:
            self.table.setEditTriggers(QAbstractItemView.AllEditTriggers)
            self.btn_modify.setText(u"")
            self.editable = True

    def select_line(self):
        """
        Select the whole line instead of a cell.
        """
        if self.table.selectionBehavior() == 0:
            self.table.setSelectionBehavior(1)
            self.btn_select_line.setStyleSheet('background-color:lightblue')
        else:
            self.table.setSelectionBehavior(0)
            self.btn_select_line.setStyleSheet('')

    def deny_muti_line(self):
        """
        Determines whether multiple lines can be selected. The default is yes.
        """
        if self.table.selectionMode() in [2, 3]:
            self.table.setSelectionMode(QAbstractItemView.SingleSelection)
            self.btn_select_single.setStyleSheet('background-color:lightblue')
        else:
            self.table.setSelectionMode(QAbstractItemView.ExtendedSelection)
            self.btn_select_single.setStyleSheet('')

    def sort_item(self):
        """
        Make column `total mark` sortable.
        """
        if self.des_sort:
            self.table.sortItems(6, Qt.DescendingOrder)
            self.des_sort = False
            self.btn_sort.setStyleSheet('background-color:lightblue')
        else:
            self.table.sortItems(6, Qt.AscendingOrder)
            self.des_sort = True
            self.btn_sort.setStyleSheet('background-color:lightblue')

    def rowcolor(self):
        """
        Make the background color of the table alternate.
        """
        self.table.setAlternatingRowColors(self.row_color)
        self.table.setStyleSheet('alternate-background-color:#e5e5e5')
        self.row_color = not self.row_color
        self.btn_rowcolor.setText(u"" if self.row_color else u"")

    def calculate_total_mark(self):
        """
        Calculate the total mark and set them to the table.
        """
        row = self.table.rowCount()
        for x in range(row):
            regular = float(self.table.item(x, 3).text()) if is_number(self.table.item(x, 3).text()) else 0.00
            midterm = float(self.table.item(x, 4).text()) if is_number(self.table.item(x, 4).text()) else 0.00
            final = float(self.table.item(x, 5).text()) if is_number(self.table.item(x, 5).text()) else 0.00

            total_mark = 0.3 * regular + 0.3 * midterm + 0.4 * final
            background = self.table.item(x, 6).background()

            item = QTableWidgetItem()
            item.setData(Qt.EditRole, round(total_mark, 2))
            self.table.setItem(x, 6, item)

            if total_mark >= 90:
                self.table.setItem(x, 7, QTableWidgetItem('A'))
            elif 80 <= total_mark < 90:
                self.table.setItem(x, 7, QTableWidgetItem('B'))
            elif 70 <= total_mark < 80:
                self.table.setItem(x, 7, QTableWidgetItem('C'))
            elif 60 <= total_mark < 70:
                self.table.setItem(x, 7, QTableWidgetItem('D'))
            else:
                self.table.setItem(x, 7, QTableWidgetItem('E'))

            self.table.item(x, 6).setBackground(background)
            self.table.item(x, 6).setTextAlignment(Qt.AlignCenter)
            self.table.item(x, 7).setBackground(background)
            self.table.item(x, 7).setTextAlignment(Qt.AlignCenter)

    def get_ave_totol_mark(self):
        """
        Calculate the average mark and show it on the message box.
        """
        row = self.table.rowCount()
        total_mark = 0.00
        for x in range(row):
            regular = float(self.table.item(x, 3).text()) if is_number(self.table.item(x, 3).text()) else 0.00
            midterm = float(self.table.item(x, 4).text()) if is_number(self.table.item(x, 4).text()) else 0.00
            final = float(self.table.item(x, 5).text()) if is_number(self.table.item(x, 5).text()) else 0.00
            total_mark += 0.3 * regular + 0.3 * midterm + 0.4 * final
        try:
            total_mark = total_mark / row
        except ZeroDivisionError:
            total_mark = 0.00
        QMessageBox.information(self, u"", u"%.2f" % total_mark, QMessageBox.Cancel)

    def get_ratio(self):
        """
        Draw a fan chart of the grade distribution of the whole class.
        """
        labels = [u"\n(90-100)", u"\n(80-89)", u"\n(70-79)", u"\n(60-69)", u"\n(60)"]
        data = [0, 0, 0, 0, 0]
        row = self.table.rowCount()
        for x in range(row):
            regular = float(self.table.item(x, 3).text()) if is_number(self.table.item(x, 3).text()) else 0.00
            midterm = float(self.table.item(x, 4).text()) if is_number(self.table.item(x, 4).text()) else 0.00
            final = float(self.table.item(x, 5).text()) if is_number(self.table.item(x, 5).text()) else 0.00
            total_mark = 0.3 * regular + 0.3 * midterm + 0.4 * final
            if total_mark >= 90:
                data[0] += 1
            elif 80 <= total_mark < 90:
                data[1] += 1
            elif 70 <= total_mark < 80:
                data[2] += 1
            elif 60 <= total_mark < 70:
                data[3] += 1
            else:
                data[4] += 1
        # make a square figure
        plt.figure(1, figsize=(6, 6))
        # For China, make the piece explode a bit
        explode = [0.1, 0, 0, 0, 0]
        # Colors used. Recycle if not enough.
        colors = ["red", "blue", "yellow", "green", "orange"]
        # Pie Plot
        # autopct: format of "percent" string;
        patches, l_text, p_text = plt.pie(data, explode=explode, colors=colors, labels=labels, autopct='%1.1f%%',
                                          pctdistance=0.7, shadow=True, startangle=90,
                                          wedgeprops={'linewidth': 0.5, 'edgecolor': "black"})
        for t in l_text:
            t.set_size(14)
        for t in p_text:
            t.set_size(20)
        plt.title(u"", bbox={'facecolor': '0.8', 'pad': 5}, fontsize=17)
        plt.show()

    def set_range(self):
        """
        Divide the sections according to the scores and distinguish them with different colors.
        """
        def set_color_to_row(table, row_count, color, highlight=True):
            if highlight:
                for j in range(table.columnCount()):
                    try:
                        self.origin_color[row_count] = table.item(row_count, j).background()
                        table.item(row_count, j).setBackground(QColor(color))
                    except AttributeError:
                        table.cellWidget(row_count, j).setStyleSheet('background-color:%s' % color)
            else:
                for j in range(table.columnCount()):
                    try:
                        table.item(row_count, j).setBackground(self.origin_color[row_count])
                    except AttributeError:
                        table.cellWidget(row_count, j).setStyleSheet('')
                    except KeyError:
                        pass

        row = self.table.rowCount()
        for x in range(row):
            regular = float(self.table.item(x, 3).text()) if is_number(self.table.item(x, 3).text()) else 0.00
            midterm = float(self.table.item(x, 4).text()) if is_number(self.table.item(x, 4).text()) else 0.00
            final = float(self.table.item(x, 5).text()) if is_number(self.table.item(x, 5).text()) else 0.00
            total_mark = 0.3 * regular + 0.3 * midterm + 0.4 * final

            if total_mark >= 90:
                set_color_to_row(self.table, x, 'pink', self.highlight)
            elif 80 <= total_mark < 90:
                set_color_to_row(self.table, x, 'lightblue', self.highlight)
            elif 70 <= total_mark < 80:
                set_color_to_row(self.table, x, 'yellow', self.highlight)
            elif 60 <= total_mark < 70:
                set_color_to_row(self.table, x, 'lightgreen', self.highlight)
            else:
                set_color_to_row(self.table, x, 'lightgray', self.highlight)

        if self.highlight:
            self.btn_highlight.setText(u"")
            self.highlight = False
        else:
            self.btn_highlight.setText(u"")
            self.highlight = True

    def set_header(self):
        """
        Make the header of the table beautiful.
        """
        font = QFont(u'', 10)
        font.setBold(True)
        self.table.horizontalHeader().setFont(font)
        self.table.setColumnWidth(0, 80)
        self.table.setColumnWidth(8, 198)
        self.table.horizontalHeader().setStyleSheet('QHeaderView::section{background:lightgray}')

    def get_book(self):
        """
        get the table data.
        :return: dict. A book of pyexcel format.
        """
        book = [self.headers[1:]]
        row = self.table.rowCount()
        for x in range(1, row):
            row_data = (self.table.item(x, 1).text(),
                        self.table.item(x, 2).text(),
                        self.table.item(x, 3).text(),
                        self.table.item(x, 4).text(),
                        self.table.item(x, 5).text(),
                        self.table.item(x, 6).text(),
                        self.table.item(x, 7).text(),
                        self.table.item(x, 8).text())
            book.append(row_data)
        return {'Sheet 1': book}
